import React from 'react';
import {connect} from 'react-redux';
import {SearchProduct} from './redux/actions';
import {Route , Switch} from "react-router-dom";
import './App.css';
import Home from "./components/Home"
import PrivateRoute from './components/AuthRoute';

class App extends React.Component {
  constructor(props){
    super(props);
    this.state = {data:[]}
    this.handleSearch = this.handleSearch.bind(this)
  }
  async handleSearch(val){
    this.props.SearchProduct(val);
  }
  render(){
  return (
    <div>
      <Switch>
        <Route exact path="/login" render={(renderProps)=> <Login {...renderProps}/>} />
        <Route exact path="/register" render={(renderProps) => <Register {...renderProps}/>} />
        <Route path="/" render={(renderProps)=> <Navbar {...renderProps}/>} />
      </Switch> 
      <Switch> 
        <PrivateRoute exact path="/" component={Home}/>
        <PrivateRoute exact path="/cart" component={Cart}/>
        <PrivateRoute exact path="/like" component={Like}/>
       </Switch>
        <Home handleSearch={this.handleSearch} />
    </div>
  );
}
}

export default connect(null,{SearchProduct})(App);
